import React from 'react';
import styles from './PopUp.module.css';
import ReactStars from 'react-stars';
import { faXmark } from '@fortawesome/free-solid-svg-icons';

export default function PopUp(props) {
  const dummy = {
    userId: 'sexking',
    img: 'https://img.khan.co.kr/news/2021/05/09/l_2021051001000864600073041.jpg',
    contents:
      'SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!SEX!!!!륶제가 쓰러지지 않아!!!',
    rate: 4,
  };

  return (
    <div className={styles.filter}>
      <button className={styles.close} onClick={props.changeValue}>
        {faXmark}
      </button>
      <div className={styles.popup}>
        {/* <p>테스트</p> */}
        <div className={styles.pop_container}>
          <div className={styles.popup_header}>
            <p className={styles.userId}>{dummy.userId}</p>
            <ReactStars count={5} value={dummy.rate} edit={false} size={20} />
          </div>
          <div className={styles.popup_contents}>
            <img className={styles.img} src={dummy.img} alt='' />
            <p className={styles.contents}>{dummy.contents}</p>
          </div>
        </div>
      </div>
    </div>
  );
}
